  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes findings of black
  bear distribution and population trends throughout Georgia and evaluates black bear
  harvest trends from 1992 to 2002. Throughout Georgia, bear populations are stable
  to increasing in size. Bait station surveys were conducted to determine distribution
  and population trends of bears in north and south Georgia during July of 2002. Results
  of these surveys, expressed as percent bait station hits, were 53.7% and 32.3% for
  stations in north and south Georgia respectively, continuing the overall trend of
  increasing visitation rates. Concurrently, bear harvest in the north, central, and
  south Georgia populations were 212, 0, and 50 bears respectively.\",\n\t\"license_title\":
